import com.home.shine.control.BytesControl;

/** 进入场景失败消息(generated by shine) */
public class EnterSceneFailedRequest extends GameRequest
{
	/** 数据类型ID */
	public static final int dataID=GameRequestType.EnterSceneFailed;
	
	public EnterSceneFailedRequest()
	{
		_dataID=GameRequestType.EnterSceneFailed;
	}
	
	@Override
	protected void copyData()
	{
		super.copyData();
	}
	
	/** 获取数据类名 */
	@Override
	public String getDataClassName()
	{
		return "EnterSceneFailedRequest";
	}
	
	/** 写入字节流(完整版) */
	@Override
	protected void toWriteBytesFull(BytesWriteStream stream)
	{
		super.toWriteBytesFull(stream);
		
		stream.startWriteObj();
		
		stream.endWriteObj();
	}
	
	/** 创建实例 */
	public static EnterSceneFailedRequest create()
	{
		EnterSceneFailedRequest re=(EnterSceneFailedRequest)BytesControl.createRequest(dataID);
		return re;
	}
	
}
